import { Form } from "react-router-dom";

function Upload() {
    return (
        <div>
            <Form>
                <div>
                    <label htmlFor="file">Choose a .txt file:</label>
                    <input
                        type="file"
                        id="file"
                        accept=".txt"
                        // onChange={handleFileChange}
                    />
                </div>
                <div>
                    <label htmlFor="name">Enter your name:</label>
                    <input
                        type="text"
                        id="name"
                    />
                </div>
                <button type="submit">Upload</button>
            </Form>
        </div>
    );
}

export default Upload;
